      SELECT DISTINCT 39 * cor1.col2 AS col0 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q10594.out
    data: |
      1287
      3198
      39
